pragma solidity ^0.4.18;

import "zeppelin-solidity/contracts/token/ERC20/CappedToken.sol";
import "zeppelin-solidity/contracts/token/ERC20/PausableToken.sol";
import "zeppelin-solidity/contracts/ownership/Claimable.sol";


contract BittWattToken is CappedToken,Claimable {

    string public constant name = "BittWattToken";
    string public constant symbol = "BWT";
    uint8 public constant decimals = 18;

    bool public enabledTransfers;

    function BittWattToken(uint _cap) public CappedToken(_cap) {
        enabledTransfers = false;
    }

    function enableTransfers() public onlyOwner {
        enabledTransfers = true;
    }

    function transfer(address _to, uint256 _value) public whenEnabled returns (bool) {
        return super.transfer(_to, _value);
    }

    function transferFrom(address _from, address _to, uint256 _value) public whenEnabled returns (bool) {
        return super.transferFrom(_from, _to, _value);
    }

    function approve(address _spender, uint256 _value) public whenEnabled returns (bool) {
        return super.approve(_spender, _value);
    }

    function increaseApproval(address _spender, uint _addedValue) public whenEnabled returns (bool success) {
        return super.increaseApproval(_spender, _addedValue);
    }

    function decreaseApproval(address _spender, uint _subtractedValue) public whenEnabled returns (bool success) {
        return super.decreaseApproval(_spender, _subtractedValue);
    }

    function getStatus() view returns (uint,uint, bool, bool, address) {
        return(cap,totalSupply_, mintingFinished, enabledTransfers, owner);
    }

    modifier whenEnabled() {
        require(enabledTransfers);
        _;
    }

}
